import './App.css';
import Message from './Components/Message';

function App() {
  return (
    <div className="Chat" style={{
      display: "flex",
      flexDirection: "column",
      alignItems: 'flex-start',
      justifyContent: 'flex-start',
    }}>
      <Message message="Hi there!" sender="Jane" owner="true" />
      <Message message="Hey" sender="Bob" owner="false" />
      <Message message="Ah doing okay" sender="Jane" owner="true" />
      <Message message="How are ya" sender="Jim" owner="false" />
      <Message message="I'm good" sender="Bob" owner="false" />
      {/* The owner determines wether the messages were send by the user */}
    </div>
  );
}

export default App;
